from typing import List
from functools import reduce

class Solution:
    def productExceptSelf(self, nums: List[int]) -> List[int]:
        '''
        20191015

        不按题目要求来, 超时
        '''
        res = []
        self.memo = {}
        for i, a in enumerate(nums):
            res.append(self.multiply(str(nums[i]), nums[:i]+nums[i+1:]))
        return res
        
    def multiply(self, key, nums):
        if key not in self.memo:
            res = 1
            for a in filter(lambda t: t != 1, nums): 
                res *= a
            self.memo[key] = res
            # self.memo[key] = reduce(lambda x,y: x*y, nums)
        return self.memo[key]

